import React, { useEffect, useState } from "react";

function Content({ response }) {
  const formatContent = (content) => {
    return content.json().then((json) => {
      return json["mythic_plus_weekly_highest_level_runs"];
    });
  };

  if (response) {
    if (response.ok) {
      return formatContent(response);
    } else {
      return <p>I'm sad!!</p>;
    }
  } else return <p>Pain goes away when I'm dizzy!</p>;
}

export default Content;
